//<button onClick={this.incrementCounter}></button>

export default class Home extends React.Component {

    constructor(props) {
        super(props)

        this.state = {
            counter: null
        }
    }    

    componentDidMount() {
        this.setState({
            counter: this.state.counter +1
        })
         document.cookie = 'Wizyty=' + this.state.counter;
    }
       
      

    render(){
               
        return(
            <div>
            <h1>Artyku≈Çy</h1>
            
            <p>Licznik: {this.state.counter}</p>
          
            </div>
            
        )
    }
}
